for key in $KEYS
do
 echo "Recherche de ${key}"
 files=`ack -l "{$key}"`
 for f in $files
 do
   echo "Replacing ${key} in ${f}"
   grep "$IMPORT" $f > /dev/null
   if [ "$?" -ne "0" ]
   then
     echo $IMPORT > /tmp/tempo
   fi
   sed -e "s/{${key}}/{ReactHtmlParser(this.props.t('${key}'))}/" $f >> /tmp/tempo
